Olvidate de las fotos y los videos borrosos. La estabilizaci&oacute;n &oacute;ptica de imagen (Optical Image Stabilization, OIS) ayuda a estabilizar tus tomas para mantener el movimiento fluido y las im&aacute;genes n&iacute;tidas, incluso cuando hay poca luz. La c&aacute;mara capta m&aacute;s luz para mejorar las tomas con poca luz.
